import React from "react";
import Navbar from "./Navbar";
import Footer from "./Footer";

// Sample data for technical skills
const skillsData = [
  { name: "Java", proficiency: "Advanced" },
  { name: "JavaScript", proficiency: "Intermediate" },
  { name: "Python", proficiency: "Intermediate" },
  { name: "HTML & CSS", proficiency: "Advanced" },
  { name: "React", proficiency: "Intermediate" },
  { name: "SQL", proficiency: "Intermediate" },
  { name: "Node.js", proficiency: "Intermediate" },
  { name: "TypeScript", proficiency: "Beginner" },
  { name: "R", proficiency: "Beginner" },
  { name: "C", proficiency: "Intermediate" },
  { name: "C+", proficiency: "Beginner" },
  { name: "Git & GitHub", proficiency: "Intermediate" },
  { name: "MQL", proficiency: "Intermediate" },
];

const projectsData = [
  {
    name: "Portfolio Website",
    description: "A personal portfolio website to showcase my skills and projects.",
    link: "#",
  },
  {
    name: "Task Manager App",
    description: "A to-do list app built with React to help manage tasks.",
    link: "#",
  },
  {
    name: "Weather App",
    description: "A weather forecasting app using an API to get real-time data.",
    link: "#",
  },
];

const collegeEducationData = {
  degree: "Bachelor of Science in Computer Science",
  institution: "Iowa State University",
  year: "Expected Graduation: Spring 2026",
};

const highSchoolEducationData = {
    school: "Waukee High School",
    graduation: "Graduation: Spring 2022",
    APEX: "Engineering Technology and Robotics APEX program"
}

export default function Skills({ viewer, setViewer, isExpanded, setIsExpanded }) {
  const pageStyles = {
    fontFamily: "Arial, sans-serif",
    padding: "20px",
    backgroundColor: "#f5f5f5",
  };

  const sectionTitleStyles = {
    color: "#2c3e50",
  };

  const introStyles = {
    marginBottom: "30px",
  };

  const cardStyles = {
    backgroundColor: "white",
    padding: "20px",
    borderRadius: "10px",
    boxShadow: "0 4px 6px rgba(0, 0, 0, 0.1)",
    width: "calc(25% - 20px)", // Ensure cards are 25% width of their row minus gap space
    minWidth: "250px", // Minimum width for a card to avoid shrinking too small
    height: "auto", // Dynamic height based on content
  };

  const projectLinkStyles = {
    color: "#3498db",
    textDecoration: "none",
    fontWeight: "bold",
  };

  const footerStyles = {
    marginTop: "50px",
    textAlign: "center",
    padding: "10px",
    // backgroundColor: "#2c3e50",
    color: "white",
  };

  // Function to group cards into rows of up to 4 cards per row
  const createRows = (data) => {
    const rows = [];
    let row = [];
    data.forEach((item, index) => {
      row.push(item);
      if (row.length === 4 || index === data.length - 1) {
        rows.push(row);
        row = [];
      }
    });
    return rows;
  };

  // Create rows for skills and projects
  const skillsRows = createRows(skillsData);
  const projectsRows = createRows(projectsData);

  return (
    <div style={pageStyles}>
      <Navbar viewer={viewer} setViewer={setViewer} />

      <section style={introStyles}>
        <h1 style={sectionTitleStyles}>Skills</h1>
        <p>
          As a Junior Software Engineer at Iowa State University, I have developed strong technical skills through my coursework, personal projects, and hands-on experience. Below is a list of 
        </p>
      </section>

      <section>
        <h2 style={sectionTitleStyles}>Technical Skills</h2>
        {/* Render skills rows */}
        {skillsRows.map((row, rowIndex) => (
          <div
            key={rowIndex}
            style={{
              display: "flex",
              justifyContent: "center", // Center the row horizontally
              gap: "20px", // Space between cards
              marginBottom: "20px", // Space between rows
              flexWrap: "wrap", // Allow wrapping of cards in the row when necessary
            }}
          >
            {row.map((skill, index) => (
              <div key={index} style={cardStyles}>
                <h3>{skill.name}</h3>
                <p>{skill.proficiency}</p>
              </div>
            ))}
          </div>
        ))}
      </section>

      <section>
        <h2 style={sectionTitleStyles}>Projects</h2>
        {/* Render project rows */}
        {projectsRows.map((row, rowIndex) => (
          <div
            key={rowIndex}
            style={{
              display: "flex",
              justifyContent: "center", // Center the row horizontally
              gap: "20px", // Space between cards
              marginBottom: "20px", // Space between rows
              flexWrap: "wrap", // Allow wrapping of cards in the row when necessary
            }}
          >
            {row.map((project, index) => (
              <div key={index} style={cardStyles}>
                <h3>{project.name}</h3>
                <p>{project.description}</p>
                <a href={project.link} target="_blank" rel="noopener noreferrer" style={projectLinkStyles}>
                  View Project
                </a>
              </div>
            ))}
          </div>
        ))}
      </section>

      <section>
        <h2 style={sectionTitleStyles}>Education</h2>
        <p>
          <strong>{collegeEducationData.degree} from {collegeEducationData.institution}</strong>, {collegeEducationData.year}
          <br />
          <strong>{highSchoolEducationData.school}, </strong> with participation in {highSchoolEducationData.APEX}, {highSchoolEducationData.graduation}
        </p>
      </section>

      <footer style={footerStyles}>
        <Footer />
      </footer>
    </div>
  );
}
